import React from 'react';
import './NavigatorItem.css';

const navigatorItem = (props) => {
	if(props.currentPage === props.label){
		console.log('bold');
	}
	else{
		console.log('lig');
	}
    return(
        <div className="Item">
            <p onClick={() => props.click(props.label)}>{props.label}</p>
        </div>
    );
};

export default navigatorItem;
